// src/App.js
import React from 'react';

import './App.css';
import Booklist from './components/Booklist/Booklist';
import {
  createBrowserRouter,
  RouterProvider,
  Route,
  Link,
} from "react-router-dom";




const App = createBrowserRouter([
  {
    path: "/",
    element: (
      <div>
        <h1>Hello World</h1>
        <Link to="about">About Us</Link>
      </div>
    ),
  },
  <div className="App">
    <Booklist />
  </div>
]);


export default App;
